import { Link } from "react-router-dom";
import { Component } from "react";
import axios from "axios";
import Cat from "../../Components/Cat/Cat";
import "./Cats.scss";

const origin = "http://localhost:9001";

class Cats extends Component {
  state = {
    catsList: [],
  };

  componentDidMount() {
    axios.get(`${origin}/cats`).then((response) => {
      console.log(response.data);
      this.setState({ catsList: response.data });
    });
  }
  render() {
    const { catsList } = this.state;
    return (
      <ul className="cats">
        {catsList.map((cat) => {
          return (
            <li className="cats__cat">
              <Cat key={cat.id} name={cat.name} image={cat.image} />
            </li>
          );
        })}
      </ul>
    );
  }
}
export default Cats;
